import React from 'react';

const AddMainUser = () => {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-lightOliveGreen p-6">
      <h1 className="text-2xl font-bold text-darkGreen mb-6">Add Main User</h1>
      <form className="space-y-4">
        {/* Add input fields for main user details */}
        <input type="text" placeholder="Name" className="p-3 border border-gray-300 rounded-md" />
        <input type="email" placeholder="Email" className="p-3 border border-gray-300 rounded-md" />
        <button type="submit" className="bg-mediumGreen text-white py-3 px-6 rounded-md text-lg">
          Add Main User
        </button>
      </form>
    </div>
  );
};

export default AddMainUser;
